body:
When I first pulled down adm-zip and its type definitions, I was trying to figure out how to use it, and wrote this piece of code:

``` js
/// <reference path="typings/adm-zip/adm-zip.d.ts" />
import admZip = require('adm-zip');
...
const file = new AdmZip.ZipFile();
```

This compiled fine in TypeScript, but I got an error at runtime informing me that `AdmZip` didn't exist.

This PR removes AdmZip from the global scope, and so you can only use the typings the correct way (through the import variable):

``` js
/// <reference path="typings/adm-zip/adm-zip.d.ts" />
import admZip = require('adm-zip');
...
const file = new admZip();
...
function processEntry(entry: admZip.IZipEntry) {
   ...
}
```

Previous return type of Object was too restrictive.

```
import bluebird = require('bluebird');
import superagent = require('superagent');

var request = bluebird.promisifyAll(superagent);

request.post('/example')
...
```

resulted in `Property 'post' does not exist on type 'Object'.`

The following options are perfectly valid but will yield a "not assignable" error:

```
var spawnOptions: grunt.util.ISpawnOptions = {grunt: true, args: ["mytask"]};
grunt.util.spawn(spawnOptions);
```
